import {   Card } from 'antd';
import  MyLayout from '../homeLayout/myLayout'

const List = (props) => {
    console.log(props);
    return (
        <MyLayout>
            <ul>
                {
                    props.shows.data.list.map((ele) => {
                        return (
                            <li>{ele.ironDir}</li>
                        )
                    })
                }
            </ul>
        </MyLayout>
    )
}

List.getInitialProps = async function () {
    const res = await fetch('https://worker-api.wanshifu.com/master/listinfo');
    const data = await res.json();
    return {
        shows: data
    }
}

export default List
